    const useStyles = makeStyles({
        picturesChangeGallery: {
            width: "auto",
            height: '25em',
            marginTop: '13em',
            borderRadius: "0.5em",
        },
    })

    const Root = styled('div')(({ theme }) => ({
        [theme.breakpoints.down('sm')]: {
            backgroundColor: "whitesmoke",
            textAlign: 'center',
            marginLeft: "3em",
            borderRadius: "0.5em"
        },
        [theme.breakpoints.up('sm')]: {
