        [theme.breakpoints.up('md')]: {
            backgroundColor: "whitesmoke",
            textAlign: 'center',
            marginLeft: "5em",
            width: '100%',
            marginLeft: 0,
            borderRadius: "0.5em"
        },
    }))

const classes = useStyles();

        return (

                <Root>

                    <Typography variant="picturePartGallery" >
                        <img src={homePageGallery}  className={classes.picturesChangeGallery}/>
                    </Typography>
                    <Typography variant="h6" >
                        "blablabla"
                    </Typography>
            </Root>

        )
    }


export default ChangingPictureGallery
